/* @flow */

import React from 'react';
import { Editor } from '../../src';
import { disabledArgtypes, commonArgs } from '../__common__/argTypes';

export const All = (args) => {

  const html = `
  <link rel="stylesheet" href="https://s3.us-east-1.amazonaws.com/webui-assets/@innovaccer/rich-text-editor/v2.0.3/design-system.css"> <p><br/></p><p style="justify-content:right;display:flex"><img src="data:image/png;base64," alt="" height="100px" width="300px"/></p><p data-test="DesignSystem-Paragraph" class="Text Text--default">html content<br/></p>
  `

  const [editorState, setEditorState] = React.useState(Editor.utils.htmlToState(html).editorState);

  const onEditorStateChange = (eState) => {
    setEditorState(eState);
  };

  return <Editor {...args} editorState={editorState} onEditorStateChange={onEditorStateChange} />;
};

All.argTypes = {
  ...disabledArgtypes,
};

All.args = {
  ...commonArgs,
};

export default {
  title: 'Library/Convert - HTMLToContent',
  component: Editor,
  parameters: {
    docs: {
      source: {
        type: 'code',
      },
    },
  },
};
